import './style.css';
import Intro from './Intro.js';
import Login from './Login.js';

const Main = () => {
    return (
    <div class="Main">
        <div class="sec1">Login<Login /></div>
        <div class="sec2">Intro<Intro /></div>
        <div class="sec3">Upload</div>
        <div class="sec4">Option</div>
    </div>
    );
}

export default Main;
